import React from 'react'
import "./App.css"
export default function Readonly({contact}) {
  return (
    <div>
      <tr>
       <td>{contact.Accountname}</td>
       <td>{contact.CreditAmount}</td>
       <td>{contact.DebitAmount}</td>
       </tr>
    </div>
  )
}
